webpackJsonp([0x3039444497115000],{"./node_modules/json-loader/index.js!./.cache/json/php-functions-die-and-exit.json":function(n,a){n.exports={data:{markdownRemark:{html:'<h2>Die and Exit</h2>\n<p>The <code>die()</code> and <code>exit()</code> functions are identical. They each take one argument (a string) containing an error message. Upon being run they output the message and immediately halt execution of the script.</p>\n<div class="gatsby-highlight">\n      <pre class="language-php"><code><span class="token delimiter important">&lt;?php</span>\n<span class="token keyword">die</span><span class="token punctuation">(</span><span class="token string">\'Die() function was run\'</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<div class="gatsby-highlight">\n      <pre class="language-php"><code><span class="token delimiter important">&lt;?php</span>\n<span class="token function">exit</span><span class="token punctuation">(</span><span class="token string">\'Exit() function was run\'</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<h4>More Information:</h4>\n<ul>\n<li><a href="https://secure.php.net/manual/en/function.die.php" rel="nofollow">php.net die() manual</a></li>\n<li><a href="https://secure.php.net/manual/en/function.exit.php" rel="nofollow">php.net exit() manual</a></li>\n</ul>',fields:{slug:"/php/functions/die-and-exit/"},frontmatter:{title:"Die and Exit"}}},pathContext:{slug:"/php/functions/die-and-exit/"}}}});
